  return (
    <>
      <Tab.Pane eventKey="first">
        <MessigeChatUi />
      </Tab.Pane>
      <Tab.Pane eventKey="first2">
        <MessigeChatUi />
      </Tab.Pane>
    </>
  );
};
const NavLink = (props) => {
  return (
    <>
      <Nav.Link eventKey="first">
        <ChatLitUi userName="userName" />
      </Nav.Link>
      <Nav.Link eventKey="first2">
        <ChatLitUi userName="userName" />
